import React from 'react';
import {BrowserRouter, Link, Switch, Route} from 'react-router-dom'
import Login from './Login'
import Home from './FirstPage'
import About from './About'
import { NavLink } from "react-router-dom";
import NavigationItem from './NavigationItem'


function Navbar(props) {

    let navItemComponent = props.navItems.map((item) => (
        <NavigationItem link={item.link}>{item.name}</NavigationItem>
      ));
    return(
        <nav>
        <div class="nav-wrapper" style={{background:"green"}}>
        <a href="/" class="brand-logo">logo</a> 
        <BrowserRouter>        <ul id="nav-mobile" class="right">
            <li><Link to="/">Home</Link></li>

            <li><Link to="/about">About</Link></li>
            <li><Link to="/login">LogIn</Link></li>
          </ul>
        <Switch>          
            <Route exact path="/" component={Home} />
            <Route path="/login" component={Login} />
            <Route path="/about" component={About} />
        </Switch>
        </BrowserRouter>

        </div>
        </nav>



    )

}

export default Navbar;
